import React, { Component } from 'react'
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import { Home } from './components/Home';
export class App extends Component {
  render() {
    return (
        <Routes>
          <Route path="/a" element={<Home/>} />
        </Routes>
    )
  }
}

export default App
